        text: 'int main() {\n    // Variables and data types\n    int x = 5, y = 10, sum;\n    float pi = 3.14;\n    char letter = \'A\';\n    char name[MAX_NAME_LEN];\n\n    // Input/Output\n    greetUser();\n    printf("Enter your name: ");\n    fgets(name, MAX_NAME_LEN, stdin);\n    name[strcspn(name, "\n")] = 0; // Remove newline\n    printf("Hello, %s!\n\n", name);\n\n    // Operators and function usage\n    sum = add(x, y);\n    printf("Sum of %d and %d is %d\n\n", x, y, sum);\n\n    // Arrays and loop\n    int numbers[5] = {1, 2, 3, 4, 5};\n    printf("Array contents: ");\n    printArray(numbers, 5);\n    printf("\n");\n\n    // Pointer demo\n    int *ptr = &x;\n    printf("Value of x via pointer: %d\n", *ptr);\n    *ptr = 20;\n    printf("New value of x: %d\n\n", x);\n\n    // Conditional statements\n    if (x > y) {\n        printf("x is greater than y\n");\n    } else if (x < y) {\n        printf("x is less than y\n");\n    } else {\n        printf("x is equal to y\n");\n    }\n\n    // Switch case\n    switch (letter) {\n        case \'A\':\n            printf("You got an A!\n");\n            break;\n        case \'B\':\n            printf("You got a B.\n");\n            break;\n        default:\n            printf("Grade not A or B.\n");\n    }\n    printf("\n");\n\n    // Loops\n    printf("While loop: ");\n    int i = 0;\n    while (i < 3) {\n        printf("%d ", i++);\n    }\n    printf("\n");\n\n    printf("Do-while loop: ");\n    i = 0;\n    do {\n        printf("%d ", i++);\n    } while (i < 3);\n    printf("\n");\n\n    printf("For loop: ");\n    for (i = 0; i < 3; i++) {\n        printf("%d ", i);\n    }\n    printf("\n\n");\n\n    // Structures\n    struct Person p1;\n    p1.id = 1;\n    strcpy(p1.name, "Alice");\n    p1.salary = 50000.50;\n\n    printf("Person Info:\n");\n    printf("ID: %d, Name: %s, Salary: %.2f\n\n", p1.id, p1.name, p1.salary);\n\n    // File handling\n    fileDemo();\n\n    return 0;\n}',
